addpath('Projekt 1/scripts')
addpath('Projekt 1/functions')
addpath('Projekt 1')

fig_folder = fullfile('wykresy', 'task_3');
if ~exist(fig_folder, 'dir')
    mkdir(fig_folder);
end
%[text] Dodatkowe Parametry
y_min = h2min;      % minimalny poziom h2
y_max = h2max; 
delta_umin = -10;
delta_umax =  10;
u_min = 2;
u_max = 300;

test_feedforward = false;
use_feedforward = false;
%[text] Wyznaczanie odpowiedzi skokowych
Ss = zeros(size(S, 1), size(S, 2), num_local);
Szs = zeros(size(Sz, 1), size(Sz, 2), num_local);
for i = 1:num_local
    [S, Sz] = step_resp(h1bars(i), h2bars(i), F1bars(i), Fdbars(i), Ts, k_tau, C1, C2, alpha1, alpha2);
    Ss(:, :, i) = S;
    Sz(:, :, i) = Sz;
end
%[text] Pętla regulacji
Tsim = 400000;
kk_dmc_SL_fuzzy = floor(Tsim/Ts) %[output:3b7a3fc5]

u_dmc_SL = ones(1,kk_dmc_SL_fuzzy)*F1pp;
h2_dmc_SL = ones(1, kk_dmc_SL_fuzzy)*h2pp;
h1_dmc_SL = ones(1, kk_dmc_SL_fuzzy)*h1pp;
z_dmc_SL = ones(1, kk_dmc_SL_fuzzy)*Fdpp;

dUp = zeros(D-1, 1);
dZp = zeros(Dz, 1);

yzad = ones(1, kk_dmc_SL_fuzzy)*h2pp;

if ~test_feedforward
    yzad(k_tau+2:kk_dmc_SL_fuzzy) = h2max;
    yzad(floor(kk_dmc_SL_fuzzy/3):kk_dmc_SL_fuzzy) = h2min*1.5;
    yzad(floor(kk_dmc_SL_fuzzy/2):kk_dmc_SL_fuzzy) = h2max/1.5;
    yzad(floor(3*kk_dmc_SL_fuzzy/4):kk_dmc_SL_fuzzy) = h2pp;
else
    yzad(floor(kk_dmc_SL_fuzzy/3):kk_dmc_SL_fuzzy) = h2pp/1.1;
    z_dmc_SL(floor(kk_dmc_SL_fuzzy/2):kk_dmc_SL_fuzzy) = Fdpp/2;
end


eps = 0.001;
for k = k_tau+2:kk_dmc_SL_fuzzy %[output:group:923776c2]
    if floor(k/1000)*1000 == k
        disp(['k = ' num2str(k)]) %[output:48f6d601]
    end
    
    h1_dmc_SL(k-1) = max(h1_dmc_SL(k-1), eps);
    h1_dmc_SL(k) = h1_dmc_SL(k-1) + Ts * (1/(2*C1*h1_dmc_SL(k-1))) * ...
            (u_dmc_SL(k-1-k_tau) + z_dmc_SL(k-1) - alpha1*sqrt(h1_dmc_SL(k-1)));
    h1_dmc_SL(k) = max(h1_dmc_SL(k), eps);
    h2_dmc_SL(k) = h2_dmc_SL(k-1) + Ts * (1/(3*C2*(h2_dmc_SL(k-1))^2)) * ...
            (alpha1*sqrt(h1_dmc_SL(k-1)) - alpha2*sqrt(h2_dmc_SL(k-1)));
    
    h2_dmc_SL(k) = max(h2_dmc_SL(k), 0);

    delta_u = 0;
    delta_z = z_dmc_SL(k) - z_dmc_SL(k-1);
    mu = evalmf(mfs, ~use_u * h2_dmc_SL(k) + use_u * u_dmc_SL(k - 1));

    S = zeros(size(S));
    Sz = zeros(size(Sz));

    for i = 1:num_local
        S = S+mu(i)*Ss(:, :, i);
        Sz = Sz+mu(i)*Ss(:, :, i);
    end

    M = zeros(N, Nu);
    Mp = zeros(N, D-1);
    Mpz = zeros(N, Dz);
    for row = 1:N
        for col = 1:Nu
            if row >= col
                M(row, col) = S(row - col + 1);
            end
        end
    end
    for row = 1:N
        for col = 1:D-1
            if row + col <= D
                Mp(row, col) = S(row + col) - S(col);
            else
                Mp(row, col) = S(D) - S(col);
            end
        end
    end
    for row = 1:N
        for col = 1:Dz-1
            if row + col <= Dz
                Mpz(row, col) = Sz(row + col) - Sz(col);
            else
                Mpz(row, col) = Sz(Dz) - Sz(col);
            end
        end
    end
    K = ( (M'*M + lambda*eye(Nu)) \ M' );
    K1 = K(1, :);

    Yzad = yzad(k) * ones(N, 1);
    if use_feedforward
        y0 = h2_dmc_SL(k) + Mp*dUp + Mpz*dZp;
    else
        y0 = h2_dmc_SL(k) + Mp*dUp;
    end
     % Funkcja celu:
    %   (Yzad - y0 - M*du)'(Yzad - y0 - M*du) + λ*du'*du
    % => 1/2 du' H du + f' du  (dla quadprog)
    H = 2 * (M' * M + lambda * eye(Nu));
    f = -2 * M' * (Yzad - y0);

    % --- ograniczenia na delta u ---
    lb = delta_umin * ones(Nu, 1);
    ub = delta_umax * ones(Nu, 1);

    % --- ograniczenia na sterowanie u ---
    T = tril(ones(Nu)); 
    u_prev = u_dmc_SL(k-1);

    u_min_vec = u_min * ones(Nu, 1);
    u_max_vec = u_max * ones(Nu, 1);

    % u_min <= u_prev*1 + T*du <= u_max
    A_u = [ T; -T];
    b_u = [ u_max_vec - u_prev * ones(Nu,1); -(u_min_vec - u_prev * ones(Nu,1))];

    % --- ograniczenia na wyjście y ---
    y_min_vec = y_min * ones(N,1);
    y_max_vec = y_max * ones(N,1);

    A_y = [ M; -M];
    b_y = [ y_max_vec - y0; -(y_min_vec - y0)];

    A = [A_u; A_y];
    b = [b_u; b_y];

    options = optimoptions('quadprog','Display','off');
    [du_opt,~,exitflag] = quadprog(H, f, A, b, [], [], lb, ub, [], options);

    if u_dmc_SL(k-1) + delta_u < u_min
        delta_u = u_min-u_dmc_SL(k-1);
    end

    if exitflag ~= 1
        delta_u = 0;
    else
        delta_u = du_opt(1);
    end
    
    
    u_dmc_SL(k) = u_dmc_SL(k-1) + delta_u;
    
    dUp = [delta_u; dUp(1:end-1)];
    dZp = [delta_z; dZp(1:end-1)];

end %[output:group:923776c2]

e = yzad-h2_dmc_SL %[output:17642bcd]
RMSE = sqrt(mean(e.^2)) %[output:470203ff]
disp(RMSE) %[output:9296f90d]
%[text] Plot
figure; %[output:1e941b84]
stairs(h2_dmc_SL, 'DisplayName', 'DMC SL - Wyjście'); %[output:1e941b84]
hold on; %[output:1e941b84]
stairs(yzad, 'DisplayName', 'Wartość zadana'); %[output:1e941b84]
grid on; xlabel('t [s]'); ylabel('h2 [cm]'); %[output:1e941b84]
legend('Location','best'); title('Wyjście obiektu - regulacja typu SL'); %[output:1e941b84]
exportgraphics(gcf, fullfile(fig_folder, 'sl_y.pdf'), 'ContentType', 'vector'); %[output:1e941b84]
figure; %[output:10c4a948]
stairs(u_dmc_SL, 'DisplayName', 'DMC SL - Sterowanie'); %[output:10c4a948]
grid on; xlabel('t [s]'); ylabel('u'); %[output:10c4a948]
legend('Location','best'); title('Wartość sterowania - regulacja typu SL'); %[output:10c4a948]
exportgraphics(gcf, fullfile(fig_folder, 'sl_u.pdf'), 'ContentType', 'vector'); %[output:10c4a948]

